Глава самопровозглашенной Донецкой народной республики (ДНР) Денис Пушилин выступил с видеообращением к гражданам, в котором сообщил о планах президента Украины Владимира Зеленского в ближайшее время отдать приказ военным перейти к наступлению на территорию ДНР и ЛНР.

Экс-командующий Народным ополчением ДНР Игорь Стрелков считает, что воевать с нынешней Украиной придется и, если ее не разгромить сейчас, ситуация не будет нормализована вообще. Она может быть только оттянута по времени, заявил эксперт. Только полный разгром Украины, свержение киевского режима, разделение Украины на Новороссию и остальную часть, которая со временем распадется, может решить проблему кардинально.  Об этом эксперт рассказал в эфире Общественной службы новостей, в программе «Стоит задуматься».

Ранее главнокомандующий Вооруженными силами Украины (ВСУ) Валерий Залужный заявил об отсутствии у Украины планов наступления в Донбассе.

Спикеры:

— Экс-командующий Народным ополчением ДНР Игорь Стрелков;
— Директор Института политических исследований Сергей Марков;
— Политолог Максим Бардин;
— Адвокат Татьяна Монтян.

